        href: "/docs/prologue/introduction/",
        title: "Introduction",
        description: "Band is an efficient deep learning platform for mobile-cloud collaborative support for multiple DNNs. Band supports backend-agnostic coordination of DNN requests on heterogeneous processors in a mobile device to cloud server. Band is currently backed by following backend machine learning frameworks.\nTensorflow v2.9.2 \u0026hellip; Android ☑ iOS ☐ gRPC ☐ Band provides Java and C APIs, as well as an official plugin for Unreal Engine.\nQuick Start # 👉 The Quick Start is intended for intermediate to advanced users.",
        content: "Band is an efficient deep learning platform for mobile-cloud collaborative support for multiple DNNs. Band supports backend-agnostic coordination of DNN requests on heterogeneous processors in a mobile device to cloud server. Band is currently backed by following backend machine learning frameworks.\nTensorflow v2.9.2 \u0026hellip; Android ☑ iOS ☐ gRPC ☐ Band provides Java and C APIs, as well as an official plugin for Unreal Engine.\nQuick Start # 👉 The Quick Start is intended for intermediate to advanced users. One page summary of how to build and customize Band. Quick Start →\nExamples # See what others have build with Band. Example →\nAbout Us # Find out who we are. About Us-\u0026gt;\n"
